import React from "react";
import {
	Card,
	CardBody,
	CardHeader,
	Media,
	Breadcrumb,
	BreadcrumbItem,
  } from "reactstrap";
import { Link } from "react-router-dom";

function Footer(props) {
	return (
		<footer className="site-footer">
			<div class="container">
				<div class="row">
					<div class="col">
					<Media>
      					<Media left href="http://www.pso2.com" target="_new">
        				<Media object data-src=".../img/pso2logo.png" alt="PSO2 logo" />
     				</Media>
					 </Media>
					</div>
				</div>
			</div>
		</footer>
	);
}

export default Footer;
